from typing import Dict, List

class Solution:
    def aryConvertDict(self, s: str) -> Dict[str, int]:
        rlt = {}
        for c in s:
            if not c in rlt:
                rlt[c] = 0
            rlt[c] += 1
        return rlt
    def minWindow(self, s: str, t: str) -> str:
        sLeg = len(s)
        tWordCount = self.aryConvertDict(sorted(t))
        startInd = 0
        allTValues = sum(tWordCount.values())
        conformWord = 0
        rlt = ''
        for i in range(sLeg):
            c = s[i]
            if c in tWordCount:
                tWordCount[c] -= 1
                if tWordCount[c] >= 0:
                    conformWord += 1
            while(conformWord == allTValues):
                if not rlt or len(rlt) > i - startInd + 1:
                    rlt = s[startInd: i +1]
                if s[startInd] in tWordCount:
                    tWordCount[s[startInd]] += 1
                    if tWordCount[s[startInd]] > 0:
                        conformWord -= 1
                startInd +=1
        return rlt



